import React, { Component } from "react";
import { Accordion, Button, Card } from 'react-bootstrap';

const Open = (props) => (
  <Accordion className="faq-accordion">
  <Card>
    <Accordion.Collapse eventKey="1" className="faq-answer"><Card.Body>Answer 1</Card.Body></Accordion.Collapse>
    <Accordion.Toggle as={Card.Header} eventKey="1" className="faq-question">Question 1</Accordion.Toggle>
  </Card>
  <Card>
    <Accordion.Collapse eventKey="2" className="faq-answer"><Card.Body>Answer 2</Card.Body></Accordion.Collapse>
    <Accordion.Toggle as={Card.Header} eventKey="2" className="faq-question">Question 2</Accordion.Toggle>
  </Card>
</Accordion>
  );

export default Open;
